import FooterDataTerms from "../../Data/Footer/FooterDataTerms";

import facebook from "../../img/facebook.png";
import instagram from "../../img/instagram.png";
import whatsapp from "../../img/whatsapp.png";
import snapchat from "../../img/snapchat.png";

import "./Footer.css";


const Footer = () => {
    let footertermscollezone = FooterDataTerms.map(terms => {
        const array = [];
        for (let i = 0; i < terms.termlink.length; i++) {
            array.push(
                <li className="terms">{terms.termlink[i]}</li>
            )
        }
        return array
    })



    return (
        <footer className="footer">
            <div className="footer__terms">
                <ul className="footer__list">
                    {footertermscollezone}
                </ul>
            </div>
            <div className="socialLinks">
                <ul className="socilalinks__list">
                    <li className="socilalinks__listitem"><a href=""><img src={facebook} alt="" className="socia"/></a></li>
                    <li className="socilalinks__listitem"><a href=""><img src={snapchat} alt="" className="socia"/></a></li>
                    <li className="socilalinks__listitem"><a href=""><img src={instagram} alt=""className="socia" /></a></li>
                    <li className="socilalinks__listitem"><a href=""><img src={whatsapp} alt="" className="socia"/></a></li>
                </ul>
            </div>
        </footer>
    )
}
export default Footer;
